import React from 'react';
import { DashboardProvider } from './context/DashboardContext';
import TokenList from './components/TokenList';
import ChartArea from './components/ChartArea';
import TradeTerminal from './components/TradeTerminal';

export default function App() {
  return (
    <DashboardProvider>
      <div className="flex px-12 py-10 min-h-screen gap-6 text-white font-sans">
        <div className="w-1/4"><TokenList /></div>
        <div className="w-2/4"><ChartArea /></div>
        <div className="w-1/4"><TradeTerminal /></div>
      </div>
      <div className="text-xs text-right text-purple-400 italic mr-4 mt-2 drop-shadow-[0_0_6px_rgba(168,85,247,0.7)]">
        powered by <span className="font-semibold text-purple-500">News2Pump</span>
      </div>
    </DashboardProvider>
  );
}
